_G.EnemySort = function(x,y) 
        local dmgx = myHero:CalcDamage(x, 100)
        local dmgy = myHero:CalcDamage(y, 100)

        dmgx = dmgx/ (1 + (SortList[x.charName]/10) - 0.1)
        dmgy = dmgy/ (1 + (SortList[y.charName]/10) - 0.1)

        local valuex = x.health/dmgx
        local valuey = y.health/dmgy

        return valuex < valuey
        end

_G.InsecSort = function(x,y) 
        if SortList[x.charName] == SortList[y.charName] then return x.health < y.health end
        return SortList[x.charName] < SortList[y.charName]
        end

class 'OrbWalking' -- {

    OrbWalking.instance = ""

    function OrbWalking:__init(name)
        self.attacking = false
        self.nextAttack = 0
        self.windUp = 0
        self.windUpTime = 0
        self.disable = true
        self.target = nil
        self.spelldis = false
        self.lastPacket = nil

        ConfigOrbWalking = scriptConfig(name .. ": OrbWalking", "Orbwalking")   
        ConfigOrbWalking:addParam("Enable", "On/Off", SCRIPT_PARAM_ONOFF, true)
        ConfigOrbWalking:addParam("Mouse", "Fellow to mouse", SCRIPT_PARAM_ONOFF, true)
        
        AddTickCallback(function() self:OnTick() end)
        AddProcessSpellCallback(function(obj, spell) self:OnProcessSpell(obj, spell) end)
        AddSendPacketCallback(function(obj) self:OnSendPacket(obj) end)
    end

    function OrbWalking.Instance(name)
        if OrbWalking.instance == "" then OrbWalking.instance = OrbWalking(name) end return OrbWalking.instance 
    end

    function OrbWalking:OnTick()
        if self.attacking and self.windUp <= GetGameTimer() then 
            self.attacking = false

            if self.target and self.target.type == "obj_AI_Hero" then 
                if (Items["Tiamat"]:Cast() or Items["RavenousHydra"]:Cast()) then 
                    self.nextAttack = 0
                end
            end
            self.target = nil

            if self.lastPacket ~= nil then
                SendPacket(tempPacket)
                self.lastPacket = nil
            end
        end

        if ConfigOrbWalking.Enable then 
            self.spelldis = false 
            if not self.disable and not self.spelldis and ConfigOrbWalking.Mouse and GetDistance(mousePos) > getHitBox(myHero) + myHero.range then 
                self.MoveToCursor()
            end 
        else 
            self.spelldis = true 
        end
    end

    function OrbWalking:MoveToCursor(range)
        if moveTick == nil or GetTickCount()-moveTick >= 71 then
            moveTick = GetTickCount()
            local moveDist = 480 + (GetLatency()/10)
            if not range then
                if GetDistance(mousePos) < moveDist and GetDistance(mousePos) > 100 then
                    moveDist = GetDistance(mousePos)
                end
            end
            local moveSqr = math.sqrt((mousePos.x - player.x)^2+(mousePos.z - player.z)^2)
            local moveX = player.x + (range and range or moveDist)*((mousePos.x - player.x)/moveSqr)
            local moveZ = player.z + (range and range or moveDist)*((mousePos.z - player.z)/moveSqr)
            player:MoveTo(moveX, moveZ)
        end 
    end

    function OrbWalking:OnSendPacket(p)
        if self.attacking and not self.disable and not self.spelldis and (p.header == 0x71 or p.header == 0x9A) then
            self.lastPacket =  copyPacket(p)
            p.pos = 1
            p:Block()
        end
    end

    function OrbWalking:OnProcessSpell(object,spell)
        if object== nil or spell == nil then return end 

        if object.isMe and spell.name:find("Attack") then
            self.target = spell.target
            self.windUp = GetGameTimer() + spell.windUpTime
            self.windUpTime = spell.windUpTime
            self.nextAttack =  GetGameTimer() + spell.animationTime
            self.attacking = true
        end 
    end

    function OrbWalking.Target()
        return OrbWalking.Instance().target
    end 



    function OrbWalking.Enable(bool)
        OrbWalking.Instance().disable = not bool
    end

    function OrbWalking.CanAttack()
        return OrbWalking.Instance():PrivateCanAttack()
    end

    function OrbWalking.NextAttack()
        return OrbWalking.Instance():_NextAttack()
    end

    function OrbWalking:_NextAttack()
        return self.nextAttack
    end

    function OrbWalking.WindUp()
        return OrbWalking.Instance().windUp
    end

    function OrbWalking.WindUpTime()
        return OrbWalking.Instance().windUpTime
    end

    function OrbWalking.ResetAA()
        OrbWalking.Instance().nextAttack = 0
    end

    function OrbWalking.Attack(target)
        return OrbWalking.Instance():PrivateAttack(target)
    end

    function OrbWalking:PrivateAttack(target)
        if self:PrivateCanAttack() then
            myHero:Attack(target)
            self.windUp = GetGameTimer() + 0.3
            self.attacking = true
            return true 
        end
        return false
    end 

    function OrbWalking:PrivateCanAttack()
        return self.nextAttack <= GetGameTimer()
    end
-- }

--Item class
class 'Item' -- {
    function Item:__init(itemId, range)
        self.id = itemId
        self.range = range
        if range == nil then self.range = math.huge end 

    end

    function Item:Ready()
        local slot = self:Slot()
        return slot ~= nil and myHero:CanUseSpell(slot) == READY
    end

    function Item:Slot()
        return GetInventorySlotItem(self.id)
    end

    function Item:ID()
        return self.id
    end

    function Item:InInventory()
        return GetInventorySlotItem(self.id) ~= nil
    end 

    function Item:Cast(target)
        local slot = self:Slot()
        if targetm and GetDistance(target) <= self.range then  
            if self:Ready() then CastSpell(slot, target) return true else return false end
        else 
            if self:Ready() then CastSpell(slot) return true else return false end
        end
    end
-- }

