class 'Spell' -- {
    function Spell:__init(ability)
       self.ability = ability

        self.cooldown = 0
        self.receive = true
        self.receivetime = math.huge
        self.casttime = 0
        self.stage = 1
        self.starttime = 0
        self.casted = false

        self.packet = nil 

        AddTickCallback(function(obj) self:OnTick() end)
    end

    function Spell:OnTick()
        if self.receivetime <=  GetGameTimer() then 
            self.receive = true
            self.receivetime = math.huge
        end
        if self.packet ~= nil and  myHero:CanUseSpell(self.ability) == READY then
            self:SetStage(1)
            self.casted = false
            self.packet = nil
        end 
    end

    function Spell:SetCooldown(number)
        self.cooldown = GetGameTimer() + number
    end

    function Spell:SetCastTime(time)
        return self.casttime
    end

    function Spell:SetCasted(bool)
        self.casted = bool
    end

    function Spell:SetPacket(p)
        self.packet = p
    end

    function Spell:GetPacket()
        return self.packet
    end

    function Spell:GetStage()
        return self.stage
    end

     function Spell:SetStage(stage)
        self.starttime = GetGameTimer()
        self.stage = stage
    end

    function Spell:GetCooldown()
        return self.cooldown
    end

    function Spell:SetReceive(bool, time)
        self.receive = bool
        self.receivetime = time
    end

    function Spell:IsCasted(stage) -- 0 == false, 1 == true, 2 == wait for packet, 3 == stage not reached
        local tempstage = stage or 1
        local tempcasted = self.casted and 1 or 0
        if tempstage > 2 and tempstage < 1 then tempstage = 1 end 

        if not self.receive then return 2 end 

        if tempstage == 1 then 
            if tempstage == self.stage and myHero:CanUseSpell(self.ability) == COOLDOWN then 
                return tempcasted 
            elseif tempstage ~= self.stage then 
                return 1
            end             
        else 
            if tempstage == self.stage and myHero:CanUseSpell(self.ability) == COOLDOWN then 
                return tempcasted
            elseif tempstage ~= self.stage then 
                return 3
            end 
        end 
        return 0
    end

    function Spell:Ready(stage) -- 0 == false, 1 == true, 2 == wait for packet, 3 == not right stage
        local tempstage = stage or 1
        if tempstage > 2 and tempstage < 1 then tempstage = 1 end   
        if myHero:GetSpellData(self.ability).level < 1 then return false end

        if not self.receive then return 2 end 

        if tempstage == self.stage and myHero:CanUseSpell(self.ability) == READY then
            return 1
        elseif myHero:CanUseSpell(self.ability) == READY then 
            return 3
        end 

        return 0
    end 

    function Spell:IsReady() 
        if self.ability == nil then return false end 
        if not self.receive then return false end
        if self.cooldown > GetGameTimer() then return false end
        return true
    end 

    function Spell:Cast(target, z, stage)
        assert(z == nil or type(z) == "number", "Spell:Cast(x, z): z, <number> or nil expected")
        local tempstage = stage or 1

        if not self:IsReady() then return false end

        local tempNetworkID = 0
        local tempX = myHero.x
        local tempZ = myHero.z

        if target ~= nil then
            if z ~= nil then tempX = target tempZ = z
            elseif type(target) == "number" then tempNetworkID = target
            else tempNetworkID = target.networkID end 
        end 

        pE = CLoLPacket(154)
        pE.dwArg1 = 1
        pE.dwArg2 = 0
        pE:EncodeF(myHero.networkID)
        pE:Encode1(self.ability)
        pE:EncodeF(tempX)
        pE:EncodeF(tempZ)
        pE:EncodeF(tempX)
        pE:EncodeF(tempZ)
        pE:EncodeF(tempNetworkID)
        OrbWalking.spelldis = true
        SendPacket(pE)
        OrbWalking.spelldis = false
        self.receive = false
        self.receivetime = GetGameTimer() + GetLatency()/1000 + 0.075
        return true
    end

-- }

