class 'Spells' -- {
    function Spells:__init()
        AddSendPacketCallback(function(obj) self:OnSendPacket(obj) end)
        AddRecvPacketCallback(function(obj) self:OnRecvPacket(obj) end)
    end

    function Spells:OnSendPacket(p)
        if p.header == 154 then 
            p.pos = 5
            local spellId = p:Decode1() 
            spellId = bit32.band(spellId, 15)
            
            if spell[spellId] == nil then return end 
            spell[spellId]:SetReceive(false, GetGameTimer() + GetLatency()/1000 + 0.1)
        end
    end

    function Spells:Spell(spell)
        return Spells.ability[spell]
    end

    function Spells:OnRecvPacket(p)
        if p.header == 181 then 
            p.pos = 1 
            local networkID  = p:DecodeF()
            if networkID ~= myHero.networkID then return end
            p.pos = 57
            local option = p:Decode1()
            if option ~= 0 then p.pos = p.pos + option*17 end
            local cooldownStart = p:DecodeF()
            local notsure = p:DecodeF()
            local notsure1 = p:DecodeF()
            local cooldownTime = p:DecodeF()
            local notsure2 = p:DecodeF()
            local notsure3 = p:Decode1()
            local spellId = p:Decode1()
            spellId = bit32.band(spellId, 15)
            local spellcost = p:DecodeF()
            local notsure4 = p:DecodeF()
            local notsure5 = p:DecodeF()
            local notsure6 = p:DecodeF()
            if spell[spellId] == nil then return end
                spell[spellId]:SetCasted(true)
                spell[spellId]:SetReceive(true, math.huge)
        elseif p.header == 23 then  
            p.pos = 1 
            local networkID  = p:DecodeF()
            if networkID ~= myHero.networkID then return end 
            local spellId = p:Decode1()
            if spell[spellId] == nil then return end
            p.pos = p.pos + 11 
            local id = p:Decode4()
            if id == 7305044 then 
                spell[spellId]:SetCasted(false)
                spell[spellId]:SetStage(2)
            end
            if id == 6647375 and spell[spellId]:GetPacket() == nil then
                spell[spellId]:SetPacket(1)
            end 

        end
    end

