        if p.header == 0x23 then 
            p.pos = 5
            if myHero.team == ((p:Decode4() == 1) and TEAM_RED or TEAM_BLUE) then 
                p.pos = p.pos + 4
                if p:DecodeF() ~= 600 and self.castedWard then
                    spell[Jumper.ability]:Cast(p:DecodeF())
                end 
            end
        end
    end

    function Jumper:OnSendPacket(p)
        if p.header == 154 and self.casted then 
            p.pos = 1
            local networkId =  p:DecodeF()
            local location = p:Decode1()
            if networkId == myHero.networkID then  
                for _, ward in ipairs(self.wardIDs) do
                    if myHero:getInventorySlot(location) == ward:ID() then 
                        if not self.castedWard then
                            self.castedWard = true
                            DelayAction(function() self.castedWard = false self.casted = false end, 4) 
                        else 
                            p:Block()
                        end
                    end
                end   
            end
        end
    end

    function Jumper.GetWardSlot()
        return Jumper.GetInstance():_GetWardSlot()
    end

    function Jumper:_GetWardSlot()
        for _, ward in ipairs(self.wardIDs) do
            if ward:Ready() then return ward:Slot() end
        end
        return nil
    end

    function Jumper.PlaceWard(x, y)
        return Jumper.GetInstance():_PlaceWard(x, y)
    end

    function Jumper:_PlaceWard(x, y)
        local slot = self:GetWardSlot()
        if slot == nil then return false end
        self.casted = true
        CastSpell(slot, x, y)
        return true
    end

