class 'LastHitting' -- { 

    function LastHitting:__init()
        local AttackName = myHero.charName == "Jayce" and 'JayceRangedAttack' or myHero.charName..'BasicAttack'
        self.projSpeed = getProjSpeed(myHero, {name = AttackName})
        self.BaseAttackSpeed = 1 / (1.6 * (1 + (UnitData[myHero.charName]['Data:AttackDelayOffsetPercent'])))
        self.windUpTime = 300

        self.enable = false 

        AddProcessSpellCallback(function(object, spell) self:OnProcessSpell(object, spell) end)
        AddTickCallback(function(obj) self:OnTick(obj) end)
    end

    function LastHitting:Enable(bool)
        --OrbWalking.Enable(bool)
        self.enable = bool
    end 

    function LastHitting:OnProcessSpell(object, spell)
        if object== nil or spell == nil or spell.target then return end 

        if spell.name:find("Attack") and spell.target.team ~= myHero.team then
            if object.isMe then 
                self.windUpTime = spell.windUpTime
                self.BaseAttackSpeed = spell.animationTime
            end 
            local aDmg = object:CalcDamage(spell.target,object.totalDamage)
            local projspeed = getProjSpeed(object, spell)
            local windUpTime = spell.windUpTime
            local animationTime = spell.animationTime

            spell.target.data = spell.target.data or {}
            spell.target.data.damage = spell.target.data.damage or {}

            local hit = (GetGameTimer() + ((GetDistance(object, spell.target)-getHitBox(spell.target))/projspeed))
            if object.isMelee then 
                hit = GetGameTimer()  
            end 
            table.insert(spell.target.data.damage, {dmg = aDmg, hittime = hit + windUpTime, aaspeed = projspeed})
            --myHero.data = 2
           -- PrintChat(tostring(#spell.target.data["damage"]))
        end 
    end
   
    function LastHitting:OnTick()
        if self.enable then 
            minions = Minions({team = {TEAM_ENEMY}, range = 450, bTargetable = true})
            table.sort(minions, function(x, y) 
                local dmgx = myHero:CalcDamage(x, myHero.totalDamage)
                local dmgy = myHero:CalcDamage(y, myHero.totalDamage)
                local valuex = x.health/dmgx
                local valuey = y.health/dmgy

                return valuex < valuey
            end)
            for i, target in ipairs(minions) do
                local aDmg = getDmg("AD",target, myHero)

                local incd = 0
                target.data = target.data or {}
                target.data.damage = target.data.damage or {}

                for j, dmg in pairs(target.data.damage) do
                    if dmg.hittime > GetGameTimer() then 
                        incd = incd + dmg.dmg
                    end 
                end

                if aDmg + incd > target.health and target.mana == 0 and target.health > 3 then
                    if #target.data.damage == 0 then
                        if aDmg >= target.health and OrbWalking.CanAttack() and (myHero.range + getHitBox(target)) + 250 > GetDistance(target) then 
                           OrbWalking.Attack(target)
                        end
                    else 
                        local hit
                        if OrbWalking.CanAttack() then 
                            hit = (GetGameTimer() + self.windUpTime)
                            if not myHero.isMelee then 
                              hit = hit +  ((GetDistance(myHero, target)-getHitBox(target))/self.projSpeed) 
                            end
                        else 
                            hit = (OrbWalking.NextAttack() + self.windUpTime)
                            if not myHero.isMelee then 
                              hit = hit +  ((GetDistance(myHero, target)-getHitBox(target))/self.projSpeed) 
                            end
                        end 

                        local enddmg = 0
                        for j, dmg in pairs(target.data.damage) do
                            if dmg.hittime > GetGameTimer() and dmg.hittime < hit then
                                enddmg = enddmg + dmg.dmg 
                            end
                        end 

                        if enddmg > target.health  then
                            if OrbWalking.CanAttack() then 
                                if spell[_E]:Ready() == 1 and GetDistance(target) < 350 then
                                    spell[_E]:Cast()
                                end 
                            else 
                                if OrbWalking.Target() == nil or OrbWalking.Target().networkID ~= target.networkID then 
                                     if spell[_E]:Ready() == 1 and GetDistance(target) < 350 then
                                        spell[_E]:Cast()
                                    end 
                                end 
                            end 
                        end

                        if aDmg+enddmg >= target.health and OrbWalking.CanAttack() and (myHero.range + getHitBox(target)) > GetDistance(target) then
                            OrbWalking.Attack(target)
                        end
                    end 
                end
            end 
        end
    end

